import './style.css'
import { Devtag } from './Components/Components';
import { Footer } from './Components/Footer';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <React.StrictMode>
    <Header/>
    <App />
    <Footer/>
    <Devtag/>
  </React.StrictMode>
);

reportWebVitals();
